import React from "react";
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import Img1 from '../img/carousel_1_2.jpg';
import Img1_slim from '../img/carousel_1_slim.jpg';
import Img2 from '../img/carousel_2_2.jpg';
import Img2_slim from '../img/carousel_2_slim.jpg';
import Img3 from '../img/carousel_3_2.jpg';
import Img3_slim from '../img/carousel_3_slim.jpg';


const useStyles = makeStyles({
  root: {
    maxWidth: 345,
    marginLeft: "auto",
    marginRight: "auto",
    marginTop: "2em"
  },
  media: {
    height: 300,
  },
  buttonStyle: {
    color: "#d4b5b0",
  },
  textStyle: {
    color: "#383e56",
  }
});

function CardComponent1() {

  const classes = useStyles();

  return (
    <Card className={classes.root}>
      <CardActionArea>
        <CardMedia
          className={classes.media}
          image={Img1}
          title="Contemplative Reptile"
        />
        <CardContent>
          <Typography gutterBottom className={classes.textStyle} variant="h5" component="h2">
            Schwangerschaft
          </Typography>
          <Typography variant="body2" className={classes.textStyle} component="p">
            Ich helfe Ihnen Ihr Baby zu bekommen. Machen m√ºssen Sies schon selber.
          </Typography>
        </CardContent>
      </CardActionArea>
      <CardActions>
        <Button size="small" className={classes.buttonStyle}>
          Mehr Informationen
        </Button>
      </CardActions>
    </Card>
  );
}

export default CardComponent1;
